import React from "react";
import "./Header.css";
import { FiPhone } from "react-icons/fi"; // Phone icon from react-icons
import logo from "../assets/logo.png" // Your logo in assets folder

const Header = () => {
  return (
    <header>
      {/* Left: Logo */}
      <div className="header-left">
        <img src={logo} alt="OfficeBanao Logo" className="logo" />
      </div>

      {/* Center: Navigation */}
      <nav className="header-center">
        <ul>
          <li><a href="#about">About</a></li>
          <li><a href="#portfolio">Portfolio</a></li>
          <li><a href="#walkthroughs">Walkthroughs</a></li>
          <li><a href="#resources">Resources</a></li>
          <li><a href="#contact">Contact Us</a></li>
        </ul>
      </nav>

      {/* Right: Phone + Tagline */}
      <div className="header-right">
        <div className="phone">
          <FiPhone className="phone-icon" />
          <span>+91 7683061117</span>
        </div>
        <div className="tagline">
          Get Premium Office Interiors your employees will love!
        </div>
      </div>
    </header>
  );
};

export default Header;
